import React from "react";
import Favourites from "../Components/Ffavourit";
import NaviBar from '../Components/Nnavibar';

const Favourit = ()=>{
    let data=[]
    for(let i=0;i<localStorage.length;i++){
        data.push(JSON.parse(localStorage.getItem(localStorage.key(i))));
        console.log(data[i]);
    }
  const items = data.map((i) =>
    <Favourites key={i.idMeal} item={i} />);
        return (
            <>
            <NaviBar isvisible={"display"}/>
            <div className="favouritCards">
                {items.length>0?items:<p style={{textAlign:"center", top:"50px"}}>You`re not have a favourite dishes</p>}
            </div>
            </>
        )
    }

export {Favourit}
